        public void Disable() { Get().Disable(); }
        public bool enabled => Get().enabled;
        public static implicit operator InputActionMap(BrowseActions set) { return set.Get(); }
        public void AddCallbacks(IBrowseActions instance)
        {
            if (instance == null || m_Wrapper.m_BrowseActionsCallbackInterfaces.Contains(instance)) return;
            m_Wrapper.m_BrowseActionsCallbackInterfaces.Add(instance);
            @ShiftLayerVisual.started += instance.OnShiftLayerVisual;
            @ShiftLayerVisual.performed += instance.OnShiftLayerVisual;
            @ShiftLayerVisual.canceled += instance.OnShiftLayerVisual;
        }

        private void UnregisterCallbacks(IBrowseActions instance)
        {
            @ShiftLayerVisual.started -= instance.OnShiftLayerVisual;
            @ShiftLayerVisual.performed -= instance.OnShiftLayerVisual;
            @ShiftLayerVisual.canceled -= instance.OnShiftLayerVisual;
        }

        public void RemoveCallbacks(IBrowseActions instance)
        {
            if (m_Wrapper.m_BrowseActionsCallbackInterfaces.Remove(instance))
                UnregisterCallbacks(instance);
        }

        public void SetCallbacks(IBrowseActions instance)
        {
            foreach (var item in m_Wrapper.m_BrowseActionsCallbackInterfaces)
                UnregisterCallbacks(item);
            m_Wrapper.m_BrowseActionsCallbackInterfaces.Clear();
            AddCallbacks(instance);
        }
    }
